import React from "react";
import { Link, Route, Routes, Navigate } from "react-router-dom";

import Home from "./pages/home";
import UserProtrait from "./pages/userPortrait";
import InventoryManage from "./pages/inventoryManage";

function App() {
  return (
    <div>
      <div>
        <Link to="/userPortrait">Link: 用户画像</Link> |{" "}
        <Link to="/inventoryManage">Link: 库存管理</Link>
      </div>
      <div>
        {/* 定义路由出口 */}
        <Routes>
          <Route path="/" element={<Navigate to="/home" />} />
          <Route path="/home" element={<Home />}>
            <Route path="userPortrait" element={<UserProtrait />}></Route>
            <Route path="inventoryManage" element={<InventoryManage />} />
          </Route>
        </Routes>
      </div>
    </div>
  );
}

export default App;
